  input: TEXT,F3A,,"Explanation for inonsistencies in the 48 hour reporting. The following
    contribution disclosures were entered twice. Clear Channel Communications, American
    Forest Assn, American Success, NFIB Safe Trust, Virginia Foxx for Congress, Pete
    Sessions fo Congress, Government is Not God. Received error report, resubmitted
    resulting in duplicate entries.  American Association of Nurse Anesthetists contribution
    filed on the Schedule A is same contribution as 48 hour report under the CRNA
    PAC.The Credit Union Legilsative Action Council contribution was not entered in
    the 48 hour report. Typing errors occurred in either the entry of the 48 hour
    report or the schedule A from Confederated Tribes of Grande Ronde, MINE PAC, and
    NSSGA ROCKPAC.  Changes have been made in Schedule A. The Valero PAC reported
    in the October quarterly report. Reported again in General Election report as
    a ROMP transfer. Sonnechein Nath and Rosenthoal LLP PAC was left out of 48 hour
    report. We have reviewed our reporting procedures and are developing systems to
    assure these mistakes will not take place in the future."
